INSERT INTO `product` (`id_p`, `judul`, `harga`, `link`, `deskripsi`, `image`, `date_added`) VALUES
(1, 'Set Kamar Tidur Tromso Bed Room', 6499000, 'https://fabelio.com/ip/set-kamar-tidur-tromso-bed-room.html', 'Kenyamanan Beristirahat ala Skandinavia.\nTromso Bed Room Set hadir agar Anda tak perlu membuang waktu untuk memadupadankan furnitur di kamar tidur. Terdiri dari Tromso Queen Bed, Wardrobe, dan Side Table, set tidur yang satu ini akan menyulap interior kamar dengan nuansa Skandinavia yang clean dan elegan. Didominasi warna putih dan cokelat muda, Anda bisa merasakan kesan adem dan nyaman untuk beristirahat.\n\nEmpuknya kasur berukuran Queen, meja kecil yang praktis, serta lemari baju yang kokoh, melengkapi kebutuhan kamar tidur Anda dengan tampilan manis. Baik untuk seorang diri maupun pasangan, Tromso Bed Room Set adalah pilihan tepat bagi Anda yang memprioritaskan kenyamanan.', 'product01.jpg', '2019-01-15 06:49:05'),
(2, 'Kursi Makan Emma Accent', 399000, 'https://fabelio.com/ip/kursi-makan-emma-accent.html', 'Jadikan Hari Lebih Asyik Saat Bersandar di Emma Accent Chair.\nDibuat dari bahan PU Seat untuk dudukan yang empuk serta Solid Beech Wood Leg, kualitas Emma Accent Chair memang tidak perlu diragukan. Lengkungannya yang unik dan estetik memberikan kesan ruangan yang minimalis namun tetap menyuguhkan tampilan yang manis. Hari-harimu akan terasa lebih lengkap kala beraktivitas dengan ditemani Emma Accent Chair', 'product02.jpg', '2019-01-15 06:49:05'),
(3, 'Kabinet Wellington 4 Drawer (Natural)', 1999000, 'https://fabelio.com/ip/kabinet-wellington-4-drawer-natural.html', 'Kabinet Minimalis untuk Serba Serbi Penyimpanan.\n\nMelihat rumah yang berantakan bisa membuat mood Anda rusak seharian. Untuk itu, Anda membutuhkan kabinet penyimpanan berkapasitas luas untuk menampung berbagai macam barang, seperti Wellington Cabinet.\n\nBerbeda dari lemari lain yang ada di pasaran, Wellington Cabinet memiliki desain minimalis yang menarik hati. Laci di bagian depan menampilkan corak kayu natural dengan tepian putih yang terlihat clean dan chic. Bentuknya yang ergonomis membuat kabinet ini mudah dipindahkan ke ruangan mana pun. Selain itu, terdapat empat susun kabinet dengan ruang yang lega untuk menampung pakaian, pernak pernik, ataupun berbagai barang lain. Selamat tinggal, rumah berantakan!', 'product03.jpg', '2019-01-15 06:49:05'),
(4, 'Lemari Pakaian Kimi Open', 2999000, 'https://fabelio.com/ip/kimi-open-wardrobe.html', 'Percantik Ruanganmu dengan Sentuhan Klasik.\n\nSama halnya dengan Anda yang selalu perlu tampil terbaik, hunian Anda pun tak ketinggalan. Tak lengkap rasannya sebuah kamar yang indah tanpa sebuah lemari terbuka fungsional untuk mempertajam kecantikan hunian Anda, seperti Kimi Open Wardrobe.\n\nBerbahan kayu sungkai dan plywood kokoh, lemari terbuka ini membuat kegiatan menata diri semakin menyenangkan. Tak perlu takut kehabisan tempat, lemari terbuka bergaya oriental ini menambahkan kelas mewah ketimuran pada setiap pakaian Anda dan keluarga. Dilengkapi dengan Cermin yang tinggi dapat memudahkan anda untuk melihat penampilan Anda secara keseluruhan. Sentuhan klasik modernnya juga sangat fleksibel dipadukan dengan berbagai gaya interior kesukaan Anda.', 'product04.jpg', '2019-01-15 06:49:05'),
(5, 'Set Meja Makan 4 Kursi Tromso Cessi Upholstered', 4999000, 'https://fabelio.com/ip/set-meja-makan-4-kursi-tromso-cessi-upholstered.html', 'Tromso Cessi Upholstered Dining Set bisa menjadi pilihan yg tepat untuk membuat suasana ruang makan anda menjadi lebih menarik. Dengan pilihan warna terang dan kursi yg nyaman, anda akan merasakan kenyamanan menikmati kebersamaan bersama orang terdekat anda.', 'product05.jpg', '2019-01-15 06:49:05'),
(6, 'Sofa Bed Cello', 2999000, 'https://fabelio.com/ip/cello-sofa-bed-9751.html', 'Sofa Lipat Penopang Tubuh Anda yang Nyaman\nPernahkah Anda tertidur di sofa dan bangun dengan leher dan otot yang kaku? Bukannya merasa segar, Anda malah merasa lelah dan butuh pijatan. Untuk menghindari kejadian tersebut, Cello Sofa Bed adalah solusi yang tepat.\n\nSofa multiwarna ini dapat dengan mudah disulap menjadi ranjang empuk untuk beristirahat sambil mendengarkan alunan musik dan angin semilir di sore hari. Baik berbentuk sofa maupun kasur, bantalan Cello dijamin nyaman menopang tubuh Anda dan membantu memberikan istirahat yang lebih tentram. Sofa lipat ini juga berguna ketika Anda hendak menjamu tamu atau kerabat dekat yang menginap singkat.', 'product06.jpg', '2019-01-15 06:49:05'),
(7, 'Sofa L Taby Bed With Storage', 7999000, 'https://fabelio.com/ip/sofa-l-taby-bed-with-storage.html', 'Cerdas Menyediakan Solusi Penyimpanan.\nMemberikan hal lebih dari sekedar sofa biasa, Taby L Sofa Bed punya fleksibilitas yang jauh lebih akomodatif untuk semua kebutuhan Anda. Sofa dengan tiga bantalan ini memiliki kapasitas penyimpanan tersembunyi di bawah Letter L. Selain itu, terdapat bantalan ekstra yang bisa dilipat atau dibuka, untuk memperluas kapasitas tempat duduk atau memberi kenyamanan lebih untuk merebahkan diri.\nDi zaman modern ini, Anda tak lagi butuh sofa medioker. Pilihan lebih canggih seperti Taby L Sofa Bed akan membuat hunian terasa cozy tanpa memakan banyak tempat. Tampilannya pun cantik dan enak dilihat. Benar-benar the whole package!', 'product07.jpg', '2019-01-15 06:49:05'),
(8, 'Meja Samping Java', 1199000, 'https://fabelio.com/ip/java-side-table.html', 'Rumah merupakan tempat yang berarti bagi kita semua. Tentunya, kita selalu berusaha membuat rumah kita semakin nyaman dengan mengisinya dengan furniture pilihan. Java Side Table adalah meja kecil yang tepat untuk diletakkan di sudut manapun di rumah Anda. Ukurannya yang tidak terlalu besar membuatnya fleksibel dengan penempatan di sudut-sudut kecil, sementara desainnya yang unik akan memberikan warna baru pada rumah kesayangan Anda.', 'product08.jpg', '2019-01-15 06:49:05'),
(9, 'Rak Baju Eugine', 1499000, 'https://fabelio.com/ip/cloth-rack.html', 'Rak Baju Gantung Untuk Koleksi Pakaian Anda.\n\nBosan dengan rak baju yang itu-itu saja? Rak Baju Eugine hadir sebagai solusi untuk Anda. Rak baju gantung Eugine sangat cocok Anda gunakan untuk menggantung koleksi pakaian Anda. Dengan Rak gantung Eugine, pakaian Anda tidak akan kusut dan memudahkan Anda untuk memilih pakaian yang akan digunakan.\n\nMaterial Rak Pakaian Gantung Eugine terbuat dari plywood HPL + kayu solid dan dilapisi dengan steel hollow, membuatnya sangat kokoh. Meskipun modelnya sangat sederhana, namun Rak Gantung Eugine sangat pas ditempatkan di kamar atau di ruang wardrobe yang tidak terlalu luas.', 'product09.jpg', '2019-01-15 06:49:05'),
(10, 'Bangku Fifties Leather', 3999000, 'https://fabelio.com/ip/bangku-fifties-leather.html', 'Kombinasi Kulit dan Kayu untuk Tampilan Prima.\n\nSejak dulu, kulit dan kayu telah menjadi unsur dominan dalam furnitur interior hunian. Tak mau ketinggalan, Bed End Fifties Leather mengajukan kombinasi menarik kulit dan kayu dalam bentuk dudukan pada kaki ranjang.\n\nDidesain dengan konsep Mid Century, Bed End Fifties terlihat elegan melengkapi kamar tidur. Foam tebal dilapisi kulit asli memberikan kenyamanan bagi siapa pun yang mendudukinya. Dengan ukurannya yang pas, aksen lengkungan Bed End Fifties meninggalkan kesan klasik yang timeless dan membumi. Cocok bagi Anda yang menyukai furnitur premium berkualitas tinggi.', 'product10.jpg', '2019-01-15 06:49:05');

